import React, {Component} from 'react';

export class AddTodo extends Component {
    state = {
        title: ''
    }

    onChange = (e) => this.setState({title: e.target.value});

    render() {
        return (
            <div>
                <input type="text" name="title" onChange={this.onChange} placeholder={'Add Todo Item'}/>
                <input type="submit" value="Submit" className='pa1' style={{flex: '1'}}/>
            </div>
        );
    }
}

export default AddTodo;
